import React from 'react';

const Contact = () => {
  return (
    <div className="contact">
      <div className="contact-info">
        <h1> Contact Us! </h1>
        <br/>
        <p> Email: <a href="mailto: screamusc@gmail.com"> screamusc@gmail.com </a> </p>
        <p> Instagram: <a href="https://www.instagram.com/screamusc/"> @screamusc </a> </p>
      </div>
    </div>
  );
};

export default Contact;
